import styled from 'styled-components';

export const Container = styled.div`
    position: absolute;
    left: 0;
    height: 100vh;
    max-width: 25rem;
    width: 100%;
    background-color: #F9F6F0;

    .head {
        width: 100%;
        height: 5.625rem;
    }
`;
